// A/B Testing Hook
const useABTest = (testName, variants) => {
  const [variant, setVariant] = useState(null);
  
  useEffect(() => {
    const userId = getCurrentUserId();
    const testVariant = hashString(userId + testName) % variants.length;
    setVariant(variants[testVariant]);
    
    // Track test assignment
    analytics.track('ab_test_assigned', {
      testName,
      variant: variants[testVariant],
      userId
    });
  }, [testName, variants]);
  
  return variant;
};

// Usage in components
const CTASection = () => {
  const buttonText = useABTest('cta_text', [
    'Get Started Now',
    'Start Your Journey',
    'Join Flutterbye',
    'Create Your First Token'
  ]);
  
  const buttonColor = useABTest('cta_color', [
    'blue',
    'purple',
    'green',
    'gradient'
  ]);
  
  return (
    <OptimizedCTAButton 
      variant={buttonColor}
      onClick={() => navigateToSignup()}
    >
      {buttonText}
    </OptimizedCTAButton>
  );
};
